import './App.css';
import Sidebar from './components/Sidebar';
import Users from './components/Users';
import man from './images/man.png'


function App() {
  return (
    <>

    <div className="container-fluid">
      <div className="row d-flex justify-content-around p-2">


        <div className="p-0 m-0" style={{width:"20%"}}>
          <Sidebar/>
        </div>



        <div className="bg-dark m-0 p-0 text-white" style={{width:"58%",height:"735px",borderRadius:"10px"}}>
          <Users/>
        </div>


        <div className="bg-dark m-0 text-white" style={{width:"20%",height:"735px",borderRadius:"10px"}}>
          <div className='d-flex mt-3 '>
            <img src={man} alt="" />
            <h4 className='d-flex align-items-center ms-3'>Super Admin</h4>
            <hr style={{color:"blue", backgroundColor:"yellow", height:"2px", border:"none", margin:"10px 0px"}} />
          </div>
        </div>

      </div>
    </div>



    </>
  );
}

export default App;
